import React from 'react';
import bg from "../img/info-bg.jpg";

const styleBg = {'background-image': 'url('+bg+')','position':'cover','height':'100%','width':'100%'};
const Infodemo = ()=> {
        return (
            <>
               <div style={styleBg}>
                    <img className='img img-fluid' src={bg} />
                    <h1>Hello Mr.</h1>
                </div> 
            </>
        )
}

export default Infodemo;
